import React from "react";
import styled from "styled-components";

function Hero() {
  return (
    <HeroSection>
      <HeroContent>
        <HeroTitle>Animal Detection System</HeroTitle>
        <HeroDescription>
        Identify and learn about local wildlife by uploading images with Wildlife Spotter. Enhance your understanding and appreciation of nature.
        </HeroDescription>
      </HeroContent>
    </HeroSection>
  );
}

const HeroSection = styled.section`
  display: flex;
  width: 584px;
  max-width: 100%;
  flex-direction: column;
  color: var(--Color, #162407);
  justify-content: center;
  margin: 57px 0 0 15px;

  @media (max-width: 991px) {
    margin-top: 40px;
  }
`;

const HeroContent = styled.div`
  display: flex;
  flex-direction: column;

  @media (max-width: 991px) {
    max-width: 100%;
  }
`;

const HeroTitle = styled.h1`
  letter-spacing: -2.04px;
  font: 500 48px/155% Manrope, sans-serif;

  @media (max-width: 991px) {
    max-width: 100%;
    font-size: 40px;
  }
`;

const HeroDescription = styled.p`
  letter-spacing: -0.26px;
  margin-top: 16px;
  font: 400 16px Manrope, sans-serif;

  @media (max-width: 991px) {
    max-width: 100%;
  }
`;

export default Hero;
